import React from "react";
import "./sidebar.css";

function SidebarPoint(props) {
  const { name } = props;
  return (
    <button onClick={handleSidebarClick} className="sidebarPointContainer">
      <h1 className="sidebarPointHeading">{name}</h1>
    </button>
  );
}

function Sidebar() {
  return (
    <div className="sidebarContainer">
      <SidebarPoint name="Home" />
      <SidebarPoint name="Doctor stats" />
      <SidebarPoint name="Hire doctor" />
      <SidebarPoint name="Hire accountant" />
    </div>
  );
}

export default Sidebar;
